import { Link } from "react-scroll";
import classes from "./NavigationList.module.css";
const NavigationList = (props) => {
  const listItems = props.menu.map((element) => (
    <Link
      activeClass={classes.active}
      onClick={props.onClick}
      to={element.to}
      spy={true}
      smooth={true}
      offset={-300}
      duration={500}
      delay={0}
    >
      {element.title}
    </Link>
  ));

  return (
    <ul className={props.className}>
      <li>
        <Link
          activeClass={classes.active}
          onClick={props.onClick}
          to="home"
          spy={true}
          smooth={true}
          offset={-300}
          duration={500}
          delay={0}
        >
          Home
        </Link>
      </li>
      <li>
        <Link
          activeClass={classes.active}
          onClick={props.onClick}
          to="about"
          spy={true}
          smooth={true}
          offset={-300}
          duration={500}
          delay={0}
        >
          About Me
        </Link>
      </li>
      <li>
        <Link
          activeClass={classes.active}
          onClick={props.onClick}
          to="projects"
          spy={true}
          smooth={true}
          offset={-300}
          duration={500}
          delay={0}
        >
          Projects
        </Link>
      </li>
      <li>
        <Link
          activeClass={classes.active}
          onClick={props.onClick}
          to="contact"
          spy={true}
          smooth={true}
          offset={-300}
          duration={300}
          delay={0}
        >
          Contact
        </Link>
      </li>
    </ul>
  );
};

export default NavigationList;
